reviewBody:
간호사 선생님은 물론이고 의사선생님도 너무친절하셔서 편안히 치료받고 왔어요^^
병원중에 치과가 제일 무서워서 긴장도 많이 하는편인데 정말 편안하게 치료받았네요 선생님께서 계속 잘하고 계시다고 ,조금 시리실거다..하시면서 미리 말씀해주시고 어르고 달래주시네요^^;
강추입니다!

